    async signOfflineTransaction(transaction, chainId) {
      let payload = {
        transaction: transaction,
        chainId: chainId,
        user: this.name
      }

      let resp = await fetch("http://127.0.0.1:3333/get", {
        "headers": {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        },

        "body": JSON.stringify({type: "sign", data: payload}),
        "method": "POST",

      });
      resp = await resp.json()
      return resp.data
    }

